How to get the last 10 messages from the mongodb?<p>In my project has some chat module. I need to create request for every N messages. How correctly create request in frontend-node-mongo. For example I got 10 last messages and scroll up for watching previous messages, how can I skip them and get next 5 messages? Now I get all messages without limit.</p>
<p><strong>Node</strong></p>
<pre><code>router.get(
  '/messages',
  async (req, res) =&gt; {
    try {
      const {user, destination} = req.query
      let userFrom = await User.findOne({email: user})
      let userTo = await User.findOne({email: destination})
      let messages = await Message.find({
        $or: [{senderId: userFrom, recipientId: userTo}, {senderId: userTo, recipientId: userFrom}]
      })
      return messages ? res.status(200).json(messages) : res.status(204)
    } catch (e) {
      res.status(500).json({message: &quot;Error&quot;})
    }
  })
</code></pre>

