Mongodb - How to find documents sharing "partially" a set of fields predefined?<p>I am trying to write a query in the MongoDB CLI to search for documents that are sharing an arbitrary number of fields, out of a specific, predetermined, set of fields.</p>
<p>To give you an example: let's consider a database composed of documents with variable fields. These fields can be shared among documents, but not necessarily.</p>
<pre><code>{
   _id: ObjectId(&quot;AAA&quot;),
   field1: &quot;value_a&quot;,
   field2: &quot;value_b&quot;,
   field3: &quot;value_l&quot;,
   field6: &quot;value_n&quot;
}
{
   _id: ObjectId(&quot;BBB&quot;),
   field1: &quot;value_c&quot;,
   field3: &quot;value_e&quot;
}
{
   _id: ObjectId(&quot;CCC&quot;),
   field2: &quot;value_f&quot;,
   field4: &quot;value_g&quot;
}
{
   _id: ObjectId(&quot;DDD&quot;),
   field1: &quot;value_m&quot;,
   field5: &quot;value_h&quot;,
   field2: &quot;value_i&quot;,
   field6: &quot;value_j&quot;,
   field7: &quot;value_k&quot;
}
{
   _id: ObjectId(&quot;EEE&quot;),
   field8: &quot;value_o&quot;
}
</code></pre>
<p>The challenge is to have a query in which one can not only specify the fields of interest, but also to <strong>specify/force the amount of fields to be shared among documents</strong> (instead of having an exact match, as mentioned below with the use of $exists). For the fields a document may have that are not in the list, it does not matter whether they are present or not.</p>
<p>For clarification, let's say we are interested in the list of fields [&quot;field1&quot;, &quot;field3&quot;, &quot;field6&quot;, &quot;field8&quot;] in the documents shown above, and we want to know which documents share <em>X</em> fields (regardless which one, as long as they are from the list we defined).</p>
<p>Let's call QUERY1 the query returning the documents sharing <strong>exactly</strong> <em>X</em> fields, as described below:</p>
<ul>
<li>Documents with exactly one field: returns the document with ObjectId(&quot;EEE&quot;)</li>
<li>Documents with exactly two fields: returns the documents with ObjectId(&quot;BBB&quot;) and (&quot;DDD&quot;)</li>
<li>Documents with exactly three fields: returns the document with ObjectId(&quot;AAA&quot;)</li>
</ul>
<p>Additionally, let's call QUERY2 the query returning documents that share <strong>at least</strong> <em>X</em> fields?</p>
<ul>
<li>Documents with at least one field: returns the documents with ObjectId(&quot;AAA&quot;), (&quot;BBB&quot;), (&quot;DDD&quot;), (&quot;EEE&quot;)</li>
<li>Documents with at least two fields: returns the documents with ObjectId(&quot;AAA&quot;), (&quot;BBB&quot;), (&quot;DDD&quot;)</li>
<li>Documents with at least three fields: returns the document with ObjectId(&quot;AAA&quot;)</li>
</ul>
<p>I have been trying with $exists, however the problem is that the query returns the documents sharing exactly those four fields, without the flexibility explained above: <code>db.documents.find({'field1' : {$exists: true}, 'field3' : {$exists: true}, 'field6' : {$exists: true}, 'field8' : {$exists: true})</code></p>
<p>Does anyone know how to write QUERY1 and QUERY2?</p>
<p>Moreover, as I would like to create new collections out of the results from those queries, ideally the queries would work with the following function at the end : <code>.forEach(function(x){db.newCollection.insert(x)});</code></p>
<p>Thank you very much for your help, very appreciated.</p>

