Problems with "updateMany" and "$pull" on array properties<p>I have the following object in my mongodb:</p>
<pre><code>{ 
  &quot;item&quot;: {
    &quot;id&quot;: &quot;/Ed/6wigZ9LTLs2mPDWDzOFD/he0vbUEvQBl2Bga/T8=&quot;,
    &quot;status&quot;: {
      &quot;likes&quot;: [
        &quot;HU0HKFoL2YQuQ2WrYhj0rYoFbRkwJ0EJEf4ML7vAp2Q=&quot;
      ]
    }
  }
}
</code></pre>
<p>Now I want to update my collection, and pull the value &quot;/Ed/6wigZ9LTLs2mPDWDzOFD/he0vbUEvQBl2Bga/T8=&quot; from all documents in the collection who have this value in their <code>item.status.liles</code> array.</p>
<p>When I use the tool <strong>Robo 3T</strong>, I can put into the command line:</p>
<pre><code>db.getCollection('mycollection').update({&quot;item.status.likes&quot;: &quot;/Ed/6wigZ9LTLs2mPDWDzOFD/he0vbUEvQBl2Bga/T8=&quot; }, { &quot;$pull&quot;:{&quot;item.status.likes&quot;: &quot;/Ed/6wigZ9LTLs2mPDWDzOFD/he0vbUEvQBl2Bga/T8=&quot;}})
</code></pre>
<p>And it says <code>Updated 0 record(s) in 2ms</code> when I execute the command (which is correct, since there is no document matching).</p>
<p>Now when I do the same in <strong>Node.JS</strong> code, like this:</p>
<pre><code>let filter = {item.status.likes: '/Ed/6wigZ9LTLs2mPDWDzOFD/he0vbUEvQBl2Bga/T8='};
let obj = {&quot;$pull&quot;:{&quot;item.status.likes&quot;:&quot;/Ed/6wigZ9LTLs2mPDWDzOFD/he0vbUEvQBl2Bga/T8=&quot;}}

collection.updateMany(filter, obj, { upsert: true }, (err, info) =&gt; {...});
</code></pre>
<p>I get <code>MongoError: Cannot apply $pull to a non-array value</code> instead.</p>
<p>If I change it to:</p>
<pre><code>collection.updateMany({}, obj, { upsert: true }, (err, info) =&gt; {...});
</code></pre>
<p>I get no error. This leads me to believe that there is a difference between &quot;no filter&quot; and &quot;empty result set&quot;, and $pull does not work on the latter.</p>
<p>Why is this? I also tried with different &quot;$pull&quot;-syntax (e.g. <code>{&quot;item&quot;:{&quot;status&quot;:{&quot;likes&quot;...</code> vs <code>item.status.likes</code>) but this didnt change anything.</p>

