How to group and count with MongoDB aggregation<p>I have a collection with different documents and their status. How can I display the status and number of each document?</p>
<pre><code>[{
        &quot;documentAStatus&quot;: &quot;OPEN&quot;,
        &quot;documentBStatus&quot;: &quot;DONE&quot;,
        &quot;documentCStatus&quot;: &quot;APPROVED&quot;
    },
    {
        &quot;documentAStatus&quot;: &quot;CANCELLED&quot;,
        &quot;documentBStatus&quot;: &quot;PHASE_OUT&quot;,
        &quot;documentCStatus&quot;: &quot;APPROVED&quot;
    },
    {
        &quot;documentAStatus&quot;: &quot;CANCELLED&quot;,
        &quot;documentBStatus&quot;: &quot;DONE&quot;,
        &quot;documentCStatus&quot;: &quot;APPROVED&quot;
    }
]
</code></pre>
<p>I would like to have such an output:</p>
<pre><code>[{
    &quot;documentAStatus&quot;: [{
            &quot;OPEN&quot;: 1
        },
        {
            &quot;CANCELLED&quot;: 2
        }
    ],
    &quot;documentBStatus&quot;: [{
            &quot;DONE&quot;: 2
        },
        {
            &quot;PHASE_OUT&quot;: 1
        }
    ],
    &quot;documentCStatus&quot;: [{
        &quot;APPROVED&quot;: 3
    }]

}]
</code></pre>
<p>I've tried grouping, but the result is not as expected.</p>
<pre><code>[{
    $unwind: '$documentAStatus'
}, {
    $group: {
        _id: {
            _id: '$_id',
            package: 'documentAStatus',
            status: '$documentAStatus'
        },
        count: {
            $sum: 1
        }
    }
}]
</code></pre>
<p>Does someone have a hint please?</p>

