Which approach is more elegant in express.js api routers?<p>I was doing some practice with express and mongoDB, when I was defining API routes I realized that people on the internet does the first method. But I think second is easier to read especially with bigger data. I wonder if there is a difference or a security issue between them. Thanks in advance.</p>
<pre><code>    // first approach
    router.route(&quot;/add&quot;).post((req, res) =&gt; {
      const email = req.body.email;
      const password = req.body.password;
      const displayName = req.body.displayName;
      const newUser = new User({ email, password, displayName });
      newUser
        .save()
        .then(() =&gt; res.json(&quot;OK&quot;))
        .catch((err) =&gt; {
          res.status(400).json(err);
        });
    });

    // second approach
    router.route(&quot;/add&quot;).post((req, res) =&gt; {
      const newUser = new User({ ...req.body });
      newUser
        .save()
        .then(() =&gt; res.json(&quot;OK&quot;))
        .catch((err) =&gt; {
          res.status(400).json(err);
        });
    });
</code></pre>

