MongoDB, sort the results by the number of matching elements between two arrays<p>In my project I use MongoDB as a database (specifically the mongoose driver for typescript, but this shouldn't matter) and I have a collection of posts that follow this schema:</p>
<pre><code>export const PostSchema = new Schema({
  author: { type: Types.ObjectId, required: true, ref: 'User' },
  text: { type: String, required: true },
  tags: [{ type: Types.ObjectId, required: true, ref: 'Tag' }],
  location: { type: PointSchema, required: true },
}

export const PointSchema = new Schema({
  type: {
    type: String,
    enum: ['Point'],
    required: true,
  },
  coordinates: {
    type: [Number],
    required: true,
  },
  locationName: {
    type: String,
    required: true,
  },
});
</code></pre>
<p>My question is if it is possible to write a query (I think an aggregation is needed) that returns all posts that meet a condition (such as that the position must be at a specific distance) and orders the results by a specific array of tags passed as an argument (in my case the array varies from user to user and represents their interests).
That is, choosing the array [&quot;sport&quot;, &quot;music&quot;, &quot;art&quot;] as an example, I would like a query that retrieves from the database all the posts that meet a certain condition (irrelevant in this question) and orders the results so that first are documents whose array of tags share elements with the array [&quot;sport&quot;, &quot;music&quot;, &quot;art&quot;], and only at the end the documents without any correspondence.
That is, something like this:</p>
<pre><code>[
{
  _id: &quot;507f191e810c19729de860ea&quot;,
  tags: [&quot;sport&quot;, &quot;art&quot;, &quot;tennis&quot;] // 2 matches
},
{
  _id: &quot;507f191e810c1975de860eg&quot;,
  tags: [&quot;sport&quot;, &quot;food&quot;] // 1 matches
},
{
  _id: &quot;607f191e810c19729de860ea&quot;,
  tags: [&quot;animals&quot;, &quot;art&quot;] // 1 matches
},
{
  _id: &quot;577f191e810c19729de860ea&quot;,
  tags: [&quot;animals&quot;, &quot;zoo&quot;] //0 matches
}
]
</code></pre>

