Unsecure Origin (Heroku App) renders NodeJS's Web Cryptography API require() undefined. Is there any workaround?<p>I'm trying to implement the experimental Web cryptography api (subtlecrypto) on my Herokuapp Nodejs server so as to encrypt the data from a gitpages -&gt; herokuapp fetch request, hiding the sensible information within from the browser console network tab to then decrypt client-side.</p>
<p>I'm following <a href="https://www.nearform.com/blog/implementing-the-web-cryptography-api-for-node-js-core/" rel="nofollow noreferrer">https://www.nearform.com/blog/implementing-the-web-cryptography-api-for-node-js-core/</a> as a reference.</p>
<p>Unfortunately, any method that I try to call from subtlecrypto comes back as undefined, spouting errors such as</p>
<pre><code>TypeError: Cannot read property 'encrypt' of undefined
</code></pre>
<p>when I try to run</p>
<pre><code>const cipher = await SubtleCrypto.encrypt({ name: 'AES-CBC', iv }, ckey, ec.encode('data'));
</code></pre>
<p>Or</p>
<pre><code>ReferenceError: getRandomValues is not defined
</code></pre>
<p>when I try to define</p>
<pre><code>const iv = getRandomValues(new Uint8Array(16));
</code></pre>
<p>The <a href="https://stackoverflow.com/questions/57146558/typeerror-digest-of-undefined-in-development-environment">TypeError, &#39;digest&#39; of undefined, in development environment</a> thread seems to pinpoint the issue (chromium deems origin as unsecure, prohibiting subtlecrypto use), but fails to provide a solution for my own environment.</p>
<h2>Here's my pipeline:</h2>
<p>In github pages (Enforce HTTPS enabled), this .js file is linked in an html page, sending a fetch request to my Heroku App</p>
<pre class="lang-js prettyprint-override"><code>var apikey, dir, documentdir;

function makeid(length) {
    var result           = '';
    var characters       = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    var charactersLength = characters.length;
    for ( var i = 0; i &lt; length; i++ ) {result += characters.charAt(Math.floor(Math.random() * charactersLength));}return result;
}

var tag=makeid(32);

document.addEventListener(&quot;adobe_dc_view_sdk.ready&quot;, function () {
    fetch(&quot;https://myapp.herokuapp.com/api/NotTheActualLink&quot;, {headers: {&quot;header1&quot; : tag, &quot;header2&quot; : aString}} )
        .then((response) =&gt; response.json())
        .then((data) =&gt; {
            window.crypto.subtle.importKey(
                &quot;raw&quot;, //can be &quot;jwk&quot; or &quot;raw&quot;
                {   //this is an example jwk key, &quot;raw&quot; would be an ArrayBuffer
                    kty: &quot;oct&quot;,
                    k: tag,
                    alg: &quot;A256CBC&quot;,
                    ext: true,
                },
                {   //this is the algorithm options
                    name: &quot;AES-CBC&quot;,
                },
                false, //whether the key is extractable (i.e. can be used in exportKey)
                [&quot;encrypt&quot;, &quot;decrypt&quot;] //can be &quot;encrypt&quot;, &quot;decrypt&quot;, &quot;wrapKey&quot;, or &quot;unwrapKey&quot;
            )
            .then(function(key){
                window.crypto.subtle.decrypt(
                    {
                        name: &quot;AES-CBC&quot;,
                        iv: data.vi, //The initialization vector you used to encrypt
                    },
                    key, //from generateKey or importKey above
                    data.iv //ArrayBuffer of the data
                )
                .then(function(decrypted){
                    //returns an ArrayBuffer containing the decrypted data
                    console.log(new Uint8Array(decrypted));

                    apikey = data.api;
                    doccy = data.docname;
                    dir = data.dir;
                })
            })
            .catch(function(err){
                console.error(err);
            });
        })
        .then(function () {
            var adobeDCView = new AdobeDC.View({ clientId: apikey, divId: &quot;adobe-dc-view&quot; });
            adobeDCView.previewFile({
                content: { location: { url: dir } },
                metaData: { fileName: doccy }
            }, { embedMode: &quot;IN_LINE&quot;, showDownloadPDF: false, showPrintPDF: false });
        });
});
</code></pre>
<p>When the app detects a request to api/NotTheActualLink, it reads the custom headers I sent it so as to get both the random string for generating the cryptographic key (ckey) and the ID of the document that I want it to respond with (id).</p>
<pre class="lang-js prettyprint-override"><code>const express = require(&quot;express&quot;);
const app = express();

const SubtleCrypto = require(&quot;crypto&quot;).webcrypto;

const { MongoClient } = require(&quot;mongodb&quot;);

const uri = process.env.MONGODB_URI;
const origin = process.env.ORIGIN_URL;
const db = process.env.DB_NAME;
const col = process.env.COL_NAME;
const path = process.env.API_PATH;
const xheader1 = process.env.X_HEADER_1;
const xheader2 = process.env.X_HEADER_2;

app.options(path, async function (req, res, next) {
  res.header('Access-Control-Allow-Origin', origin);
  res.header('Access-Control-Allow-Methods', 'GET,OPTIONS');
  res.header('Access-Control-Allow-Headers', xheader1.concat(&quot;, &quot;,xheader2));
  next();
});

app.get(path, async function (req, res) {
  const client = new MongoClient(uri, { useUnifiedTopology: true });
  res.header('Access-Control-Allow-Origin', origin);
  res.header('Access-Control-Allow-Methods', 'GET,OPTIONS');
  res.header('Access-Control-Allow-Headers', xheader1.concat(&quot;, &quot;,xheader2));

  try {
    await client.connect();
    console.log(&quot;isSecureContext= &quot;+app.isSecureContext);
    var ckey = req.header(xheader1);
    var id = req.header(xheader2);
    console.log(&quot;key= &quot;+ckey);
    console.log(&quot;id= &quot;+id);

    const database = client.db(db);
    const collection = database.collection(col);
    const query = { docId: id };
    const cursor = await collection.findOne(query);
    const result = cursor;

    const ec = new TextEncoder();
    const algorithm = 'aes-256-cbc';
    const iv = getRandomValues(new Uint8Array(16));
    const cipher = await SubtleCrypto.encrypt({ name: 'AES-CBC', iv }, ckey, ec.encode(result));
    const data = await SubtleCrypto.encrypt({ name: 'AES-CBC', iv }, ckey, cipher);

    var response =
    {
      iv: iv.toString('hex'),
      dater: data.toString('hex')
    };

    return res.json(response);

  } catch (err) {
    console.log(err);
  }
  finally {
    await client.close();
  }
});

app.listen(process.env.PORT || 3000,
  () =&gt; console.log(&quot;Server is running...&quot;));
</code></pre>
<p>From there it establishes connection to my MongoDB cluster (link: mongodb+srv://yada:yadayada@foo.bar.mongodb.net/mydatabase?retryWrites=true&amp;w=majority) and retrieves the document with the data that I want to encrypt and sends to the client browser. Or at least that's what it was supposed to be doing.</p>
<p>I just can't understand which of these interactions makes the connection insecure, disabling subtlecrypto.</p>
<h2>What can I do to make the origin secure?</h2>
<p>Also, <code>console.log(&quot;isSecureContext= &quot;+app.isSecureContext);</code> doesn't seem to target the origin, but window.isSecureContext does not work either because the app (it's just the above .js file) isn't running in a browser window.</p>

